import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import '../styles/Home.css';

const Home = () => {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6 }
  };

  return (
    <div className="home">
      <section className="hero">
        <div className="container">
          <motion.div 
            className="hero-content"
            initial={fadeIn.initial}
            animate={fadeIn.animate}
            transition={fadeIn.transition}
          >
            <h1>Revolutionizing Fresh Produce Packaging</h1>
            <p>A research-driven sustainable solution to reduce post-harvest losses in papayas and promote eco-friendly alternatives.</p>
            <div className="hero-buttons">
              <Link to="/research" className="btn btn-primary">View Research</Link>
              <Link to="/impact" className="btn btn-outline">Our Impact</Link>
            </div>
          </motion.div>
        </div>
      </section>

      <section className="features section">
        <div className="container">
          <div className="section-title">
            <h2>Key Features</h2>
            <p>Discover how The Green Crate combines innovation with sustainability</p>
          </div>

          <div className="features-grid">
            <motion.div 
              className="feature-card"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.2 }}
            >
              <div className="feature-icon">🌱</div>
              <h3>Biodegradable Material</h3>
              <p>Made from sustainable bamboo fibers, ensuring complete biodegradability while maintaining durability.</p>
            </motion.div>

            <motion.div 
              className="feature-card"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.4 }}
            >
              <div className="feature-icon">🔬</div>
              <h3>Antimicrobial Coating</h3>
              <p>Innovative citric and lactic acid treatment prevents microbial growth and extends produce shelf life.</p>
            </motion.div>

            <motion.div 
              className="feature-card"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ delay: 0.6 }}
            >
              <div className="feature-icon">📊</div>
              <h3>Proven Results</h3>
              <p>20% reduction in weight loss and significant decrease in microbial activity during storage.</p>
            </motion.div>
          </div>
        </div>
      </section>

      <section className="research-preview section">
        <div className="container">
          <div className="research-content">
            <motion.div 
              className="research-text"
              initial={{ opacity: 0, x: -50 }}
              whileInView={{ opacity: 1, x: 0 }}
              viewport={{ once: true }}
            >
              <h2>Research-Backed Innovation</h2>
              <p>Our solution is the result of extensive scientific research and testing, focusing on addressing real-world challenges in the fresh produce industry.</p>
              <Link to="/research" className="btn btn-primary">Learn More</Link>
            </motion.div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
